Write a Python function to calculate the factorial of a number using recursion.
Certainly! Here's a Python function that calculates the factorial of a number using recursion:

```python
def factorial(n):
    if n == 0:
        return 1
    else:
        return n * factorial(n-1)
```

In this function, we first check if the input number `n` is equal to 0. If it is, we return 1, as the factorial of 0 is defined as 1. Otherwise, we recursively call the `factorial` function with `n-1` and multiply the result by `n`. This process continues until `n` reaches 0, at which point the recursion stops and the final result is returned.

You can use this function to calculate the factorial of any non-negative integer. For example, `factorial(5)` would return 120, as 5! (5 factorial) is equal to 5 * 4 * 3 * 2 * 1 = 120."]

